import Home from "../pages/Home";
import CreateQuiz from "~/pages/CreateQuiz";

// Public routes
const publicRoutes = [
    {path: '/', component: Home},
    {path: '/createquiz', component: CreateQuiz},
]

const privateRoutes = [

]

export { publicRoutes, privateRoutes}
